import React, { Component } from "react";

import PageLink from "../common/PageLink";

import "./style.scss";

class MainView extends Component {
  render() {
    return (
      <div className="main-view">
        <div className="content">
          <div className="menu-bar">
            <div className="left-items">
              <span>PRODUCTS</span>
              <span>SOLUTIONS</span>
              <span>SUPPORT</span>
              <span>COMPANY</span>
            </div>
            <div className="logo">cadence</div>
            <div className="right-items">
              <span><i className="fas fa-user" /></span>
              <i className="fas fa-search"></i>
              <i className="fas fa-globe-americas"></i>
            </div>
            <div></div>
          </div>
          <div className="top-banner">
            <span className="title">UNLEASH IMAGINATION</span>
            <span className="caption">
              Find out how Cadence is accelerating electronic innovation to
              transform the world
            </span>
            <button className="watch-button">Watch Video</button>
          </div>
          <div className="links">
            <PageLink
              icon={require("../../assets/imgs/Cadence Live.svg")}
              text={"Cadence Live"}
            />
            <PageLink
              icon={require("../../assets/imgs/Download.svg")}
              text={"Download"}
            />
            <PageLink
              icon={require("../../assets/imgs/Careers.svg")}
              text={"Careers"}
            />
            <PageLink
              icon={require("../../assets/imgs/Training.svg")}
              text={"Training"}
            />
            <PageLink
              icon={require("../../assets/imgs/Newsroom.svg")}
              text={"Newsroom"}
            />
            <PageLink
              icon={require("../../assets/imgs/Resource Library.svg")}
              text={"Resource Library"}
            />
          </div>
          <div className="intelli-zone-banner">
            <div className="title">Intelligent Design Zone</div>
          </div>
          <div className="toshiba-banner">
            <img
              className="banner-image"
              alt="img"
              src={require("../../assets/imgs/Background Dark Gray.svg")}
            />
          </div>
          <div className="drive-innov-tech"></div>

          <div className="blog-carousel"></div>
          <div className="bottom-banner"></div>
          <div className="footer"></div>
        </div>
      </div>
    );
  }
}

export default MainView;
